import React from "react";
import { BrowserRouter } from 'react-router-dom';

import Header from './components/Header';
import Footer from './components/Footer';

import Routes from './Routes';

import './App.css';

function App() {

  return (

    <BrowserRouter>

      <CompetenciasProvider>

          <Header />

          <Routes />

          <Footer />

      </CompetenciasProvider>

    </BrowserRouter>

  );

}

export default App;
